//SPDX-License-Identifier :MIT

pragma solidity ^0.8.0;



contract FundMe{

    mapping(address  sender => uint256 value) public addressToAmountFunded;

    event Success(address from, address to, uint256 value);

    function fund() public payable{
        uint256 min_usd = 5;                             //$5

        require(msg.value >=min_usd, "Send Atleast $5 worth of ETH");
        emit Success(msg.sender, address(this), msg.value);
        addressToAmountFunded[msg.sender] += msg.value;

    }
    function withdraw()public payable {
        uint256 amtToBeWithdrawl = addressToAmountFunded[msg.sender];
        address senderAddress = msg.sender;

         (bool result,) = payable(senderAddress).call{value:amtToBeWithdrawl}('');
         require(result, "Failure");
         addressToAmountFunded[senderAddress] = 0;


    }
}

